import React from 'react'

const Content = () =>{
   const [rockets,setRockets] = React.useState(null);
    React.useEffect(() => {
        fetch("https://api.spacexdata.com/v3/launches?limit=100")
          .then((res) => res.json())
          .then((res) =>{
            console.log("res", res)
            setRockets(res)
          });
      }, []);
    return(
        <>
          {
              rockets && rockets.map(rocket =>{
                <ImgMediaCard 
                  title={rocket.rocket.rocket_name}
                 image={rocket.links.mission_patch_small} 
                 />
              })
          }
        </>
       
    )
}

export default Content;
